import React from 'react';
import { Link } from 'react-router-dom';

function _test_(){ 
    return (
        <div>
            <ul>
                <li><Link to="/">Main</Link></li>
                <li><Link to="/home">Home</Link></li>
                <li><Link to="/login">login</Link></li>
            </ul>
            <hr/>
        </div>
    );
};

export default _test_;
